pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED

import "./Interfaces/ITrustAnchorManager.sol";

/// @dev
/// | The Trust Anchor Extra Data [Unique] reference contract
/// | This contract is an example of the type of parameters most useful in a Regulatory/Onboarding/Verification context. A very malleable construction of variables is used, with:
/// | a) a mapping of hashes (for lookups on various databases) with a string name for human readability.
/// | b) a mapping of ip endpoints (for the transfer of sensitive documents) with a string name for human readability.
/// | c) a mapping of 256-bit numeric identifiers (for various indexing purposes) with a string name for human readability.
/// | d) a string for public metadata.

contract TrustAnchorExtraData_Unique {

    /// @dev Event for creating an End Point
    event EVT_setTrustAnchorEndPointCreated(address indexed _trustAnchorAddress, string _endpointName, uint8[4] _ipv4Address);
    /// @dev Event for updating an End Point
    event EVT_setTrustAnchorEndPointUpdated(address indexed _trustAnchorAddress, string _endpointName, uint8[4] _ipv4Address);

    /// @dev Event for Data Retrieval Endpoint is Enabled for a specific Endpoint name.
    event EVT_setTrustAnchorEndpointIsEnabled(address indexed _trustAnchorAddress, string _endpointName, bool _isEnabled);

    /// @dev Event for creating a Hash Mapping
    event EVT_setTrustAnchorHashMappingCreated(address indexed _trustAnchorAddress, string _hashMappingName, bytes32 _hashMappingValue);
    /// @dev Event for updating a Hash Mapping
    event EVT_setTrustAnchorHashMappingUpdated(address indexed _trustAnchorAddress, string _hashMappingName, bytes32 _hashMappingValue);

    /// @dev Event for creating a Numeric Identifier
    event EVT_setTrustAnchorNumericIdentifierCreated(address indexed _trustAnchorAddress, string _numericIdentifierName, uint256 _numericIdentifierValue);
    /// @dev Event for updating a Numeric Identifier
    event EVT_setTrustAnchorNumericIdentifierUpdated(address indexed _trustAnchorAddress, string _numericIdentifierName, uint256 _numericIdentifierValue);

    /// @dev Event for creating a Key-Value Pair (String to String relationship)
    event EVT_setTrustAnchorKeyValuePairCreated(address indexed _trustAnchorAddress, string _keyValuePairName, string _keyValuePairValue);
    /// @dev Event for updating a Key-Value Pair (String to String relationship)
    event EVT_setTrustAnchorKeyValuePairUpdated(address indexed _trustAnchorAddress, string _keyValuePairName, string _keyValuePairValue);


    /// @dev Event for setting Public Metadata
    event EVT_setTrustAnchorPublicMetaData(address indexed _trustAnchorAddress, string _metaData);

    /// @dev Struct for a Trust Anchor data retrieval ip address endpoints with a string to associated names.
    struct endpoint {
        string endpointName;
        uint8[4] ipv4Address;

        bool isEnabled;
        bool doesExist;
    }

    /// @dev Struct for the "hash mappings" for lookups on various databases.
    struct hashMapping {
        string hashName;
        bytes32 hashValue;

        bool doesExist;
    }

    /// @dev Struct for the "numeric identifiers" for various indexing purposes.
    struct numericIdentifier {
        string numericIdentifierName;
        uint256 numericIdentifierValue;

        bool doesExist;
    }

    /// @dev Struct for the "key value pair" for various indexing purposes.
    struct keyValuePair {
        string keyValuePairName;
        string keyValuePairValue;

        bool doesExist;
    }

    /// @dev Struct for a Trust Anchor unique extraData
    struct trustAnchorUniqueExtraDataParameters {
        mapping(bytes32 => endpoint) keccakHash_to_dataRetrievalEndpoint;
        mapping(bytes32 => hashMapping) keccakHash_to_hashMapping;
        mapping(bytes32 => numericIdentifier) keccakHash_to_numericIdentifier;
        mapping(bytes32 => keyValuePair) keccakHash_to_keyValuePair;

        string publicMetaData;

        bytes32[] dataRetrievalEndpointHashArray;
        bytes32[] hashMappingsHashArray;
        bytes32[] numericIdentifiersHashArray;
        bytes32[] keyValuePairsHashArray;

        bool doesExist;
    }

    /// @dev Mapping for a Trust Anchor to its unique extraData parameters.
    mapping(address => trustAnchorUniqueExtraDataParameters) extraData_uniqueParameters;

    /// @dev The owner of this contract.
    address owner = address(0);

    /// @dev The Trust Anchor Manager address that this contract is bound to.
    address trustAnchorManagerAddress = address(0);

    /// @dev Initializes this contract with the owner set to the calling public address.

    constructor() {
        owner = msg.sender;
    }

    /// @param _trustAnchorManagerAddress The smart contract address for the Trust Anchor Manager that should be linked.
    /// @dev Links Trust Anchor Manager to this contract's function flow.
    /// @return result
    ///    | false: [ will never return false due to require() ]
    ///    | true: trust anchor manager address set correctly

    function setTrustAnchorManagerAddress(address _trustAnchorManagerAddress) public returns (bool result) {
        require(_trustAnchorManagerAddress != address(0));

        trustAnchorManagerAddress = _trustAnchorManagerAddress;

        //trust anchor manager address set correctly
        return true;
    }

    /// @dev Gets the Trust Anchor Manager associated to this contract.
    /// @return result trust anchor manager address

    function getTrustAnchorManagerAddress() public view returns (address result) {
        //get trust anchor manager address
        return trustAnchorManagerAddress;
    }

    /// @param _trustAnchorAddress The Trust Anchor address that is checked for unique extraData availability.
    /// @dev Checks whether a specific Trust Anchor has extraData associated to it, updates if necessary, and returns the status.
    /// @return result
    ///    | false: trust anchor has no extraData parameters allocated
    ///    | true: trust anchor does has extraData parameters allocated

    function doesTrustAnchorHaveUniqueExtraData(address _trustAnchorAddress) public view returns (bool result) {
        if (extraData_uniqueParameters[_trustAnchorAddress].doesExist == true) {
            //trust anchor does has extraData parameters allocated
            return true;
        } else {
            //trust anchor has no extraData parameters allocated
            return false;
        }
    }

    // ** extraData data retrieval ** //

    /// @param _endpointName The name of the endpoint.
    /// @param _ipv4Address The ipv4 address, an array of 4 uint8's (0-255) corresponding to w.x.y.z components of an ip address.
    /// @dev Checks whether a specific Trust Anchor has "generic" extraData associated to it with a specific endpoint name, updates if necessary, and returns the status. Sets the endpoint to "enabled" status if it's being set for the first time.
    /// @notice Called by an already setup Trust Anchor.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: endpoint set for the first time
    ///    | 2: endpoint updated

    function setTrustAnchorDataRetrievalEndpoint(string memory _endpointName, uint8[4] memory _ipv4Address) public returns (uint8 result) {
        bytes32 endpointKeccak = keccak256(abi.encodePacked(_endpointName));

        //@note: need to check Trust Anchor jurisdiction in Trust Anchor manager lookup
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {

            // get the endpoint if it already exists, otherwise create a new endpoint.
            endpoint storage newEndpoint = extraData_uniqueParameters[msg.sender].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

            // set the parameters based on inputs.
            newEndpoint.endpointName = _endpointName;

            newEndpoint.ipv4Address[0] = _ipv4Address[0];
            newEndpoint.ipv4Address[1] = _ipv4Address[1];
            newEndpoint.ipv4Address[2] = _ipv4Address[2];
            newEndpoint.ipv4Address[3] = _ipv4Address[3];

            // checks whether this particular endpoint already exists for this Trust Anchor.
            if (newEndpoint.doesExist == true) {
                // emit updated event
                emit EVT_setTrustAnchorEndPointUpdated(msg.sender, _endpointName, _ipv4Address);
                //endpoint updated
                return 2;
            } else {
                // if endpoint doesn't already exist, set the parameters required for further lookups.
                newEndpoint.doesExist = true;
                newEndpoint.isEnabled = true;

                // sets the global "doesExist" for this Trust Anchor to true.. if it was already set, this doesn't cost
                // any extra gas at the end of the day because it's not changing state.
                extraData_uniqueParameters[msg.sender].doesExist = true;

                // pushes the new endpointKeccak to the endpoint array.
                extraData_uniqueParameters[msg.sender].dataRetrievalEndpointHashArray.push(endpointKeccak);

                // emit created event
                emit EVT_setTrustAnchorEndPointCreated(msg.sender, _endpointName, _ipv4Address);

                //endpoint set for the first time
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _endpointName The name of the endpoint.
    /// @param _isEnabled The boolean yes/no of whether this endpoint should be set to enabled or not.
    /// @dev Checks whether a specific Trust Anchor has "generic" extraData associated to it with a specific endpoint name, and updates the isEnabled if it already exists, and returns the status.
    /// @notice Called by an already setup Trust Anchor.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: endpoint does not exist
    ///    | 2: endpoint's enabled status updated

    function setTrustAnchorDataRetrievalEndpointIsEnabled(string memory _endpointName, bool _isEnabled) public returns (uint8 result) {
        bytes32 endpointKeccak = keccak256(abi.encodePacked(_endpointName));

        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {

            // get the endpoint if it already exists.
            endpoint storage existingEndpoint = extraData_uniqueParameters[msg.sender].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

            // if this endpoint already exists, set the isEnabled flag based on input parameters.
            if (existingEndpoint.doesExist == true) {
                existingEndpoint.isEnabled = _isEnabled;

                // emit the updated enabled event
                emit EVT_setTrustAnchorEndpointIsEnabled(msg.sender, _endpointName, _isEnabled);

                //endpoint's enabled status updated
                return 2;
            } else {
                //endpoint does not exist
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @dev Gets the number of endpoints associated to this Trust Anchor.
    /// @return result the number of endpoints associated to this Trust Anchor.

    function getTrustAnchorNumberOfEndpoints(address _trustAnchorAddress) public view returns (uint256 result) {
        return extraData_uniqueParameters[_trustAnchorAddress].dataRetrievalEndpointHashArray.length;
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _index The index within this Trust Anchor's endpoint array.
    /// @dev Gets the endpoint name for a specific index within the Trust Anchor's endpoint array.
    /// @notice Checks to make sure that the _index parameter is not out of bounds.
    /// @return doesExist whether the endpoint data exists, ( false, "" ): endpoint data does not exist
    /// @return endpointName the endpoint name

    function getTrustAnchorEndpointNameByIndex(address _trustAnchorAddress, uint256 _index) public view returns (bool doesExist, string memory endpointName) {
        // checks whether this particular hash mapping already exists for this Trust Anchor.
        if (extraData_uniqueParameters[_trustAnchorAddress].dataRetrievalEndpointHashArray.length > _index) {
            bytes32 endpointKeccak = extraData_uniqueParameters[_trustAnchorAddress].dataRetrievalEndpointHashArray[_index];

            endpoint storage existingEndpoint = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

            //endpoint data exists, returns the endpoint name
            return (true, existingEndpoint.endpointName);
        } else {
            //endpoint data does not exist
            return (false, "");
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _endpointName The name of the endpoint.
    /// @dev Gets the data retrieval parameters (whether it exists, the actual endpoint data, and whether it's enabled) for this particular _endpointName.
    /// @return doesExist whether the endpoint data exists, ( false, [0, 0, 0, 0], false ): endpoint data does not exist
    /// @return ipv4Address the ipv4 components
    /// @return isEnabled whether this endpoint is enabled

    function getTrustAnchorDataEndpoint(address _trustAnchorAddress, string memory _endpointName) public view returns (bool doesExist, uint8[4] memory ipv4Address, bool isEnabled) {
        bytes32 endpointKeccak = keccak256(abi.encodePacked(_endpointName));

        // gets the endpoint.
        endpoint storage existingEndpoint = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

        // checks whether this particular endpoint already exists for this Trust Anchor.
        if (existingEndpoint.doesExist == true) {
            //if the endpoint exists, the extraData ip address parameters for this Trust Anchor have a proper endpoint.

            //endpoint data exists, and the return components
            return (true, existingEndpoint.ipv4Address, existingEndpoint.isEnabled);
        } else {
            //endpoint data does not exist
            return (false, [0,0,0,0], false);
        }
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @param _endpointKeccak The endpoint keccak
    /// @dev Gets the endpoint name for a specific endpoint keccak for a Trust Anchor.
    /// @return endpointName endpoint data exists, returns the endpoint name
    function getTrustAnchorEndpointNameByEndpointKeccak(address _trustAnchorAddress, bytes32 _endpointKeccak) public view returns (string memory endpointName) {
        //returns the endpoint name
        return extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_dataRetrievalEndpoint[_endpointKeccak].endpointName;
    }

    // ** extraData hash mappings ** //

    /// @param _hashName The name of the hash mapping.
    /// @param _hashValue The value for this hash mapping, as a bytes32 (256 bits) format.
    /// @dev Checks whether a specific Trust Anchor has "unique" extraData associated to it with a specific hash name, updates if necessary, and returns the status.
    /// @notice Called by an already setup Trust Anchor.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: hash mapping set for the first time
    ///    | 2: hash mapping updated

    function setTrustAnchorHashMapping(string memory _hashName, bytes32 _hashValue) public returns (uint8 result) {
        bytes32 hashValueKeccak = keccak256(abi.encodePacked(_hashName));

        //@note: need to check Trust Anchor jurisdiction in Trust Anchor manager lookup
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {

            // get the hash mapping if it already exists, otherwise create a new hash mapping.
            hashMapping storage newHashValue = extraData_uniqueParameters[msg.sender].keccakHash_to_hashMapping[hashValueKeccak];

            // set the parameters based on inputs.
            newHashValue.hashName = _hashName;
            newHashValue.hashValue = _hashValue;

            // checks whether this particular hash mapping already exists for this Trust Anchor.
            if (newHashValue.doesExist == true) {
                // emit updated event
                emit EVT_setTrustAnchorHashMappingUpdated(msg.sender, _hashName, _hashValue);

                //hash mapping updated
                return 2;
            } else {
                // if hash mapping doesn't already exist, set the parameters required for further lookups.
                newHashValue.doesExist = true;

                // sets the global "doesExist" for this Trust Anchor to true.. if it was already set, this doesn't cost
                // any extra gas at the end of the day because it's not changing state.
                extraData_uniqueParameters[msg.sender].doesExist = true;

                // pushes the new hashValueKeccak to the hash mappings array.
                extraData_uniqueParameters[msg.sender].hashMappingsHashArray.push(hashValueKeccak);

                // emit created event
                emit EVT_setTrustAnchorHashMappingCreated(msg.sender, _hashName, _hashValue);

                //hash mapping set for the first time
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @dev Gets the number of hash mappings associated to this Trust Anchor.
    /// @return result the number of hash mappings associated to this Trust Anchor.

    function getTrustAnchorNumberOfHashMappings(address _trustAnchorAddress) public view returns (uint256 result) {
        return extraData_uniqueParameters[_trustAnchorAddress].hashMappingsHashArray.length;
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _index The index within this Trust Anchor's hash mapping array.
    /// @dev Gets the hash mapping name for a specific index within the Trust Anchor's hash mapping array.
    /// @notice Checks to make sure that the _index parameter is not out of bounds.
    /// @return doesExist whether the hash mapping data exists, ( false, "" ): hash mapping data does not exist
    /// @return hashMappingName the hash mapping name

    function getTrustAnchorHashMappingNameByIndex(address _trustAnchorAddress, uint256 _index) public view returns (bool doesExist, string memory hashMappingName) {
        // checks whether this particular endpoint already exists for this Trust Anchor.
        if (extraData_uniqueParameters[_trustAnchorAddress].hashMappingsHashArray.length > _index) {
            bytes32 hashMappingKeccak = extraData_uniqueParameters[_trustAnchorAddress].hashMappingsHashArray[_index];

            hashMapping storage existingHashMapping = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_hashMapping[hashMappingKeccak];

            //hash mapping data exists, returns the hash mapping name
            return (true, existingHashMapping.hashName);
        } else {
            //hash mapping data does not exist
            return (false, "");
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _hashMappingName The name of the hash mapping.
    /// @dev Gets the hash mapping value parameters (whether it exists, the actual hash mapping value) for this particular _hashMappingName.
    /// @return doesExist whether hash mapping data exists, ( false, 0 ): hash mapping data does not exist
    /// @return hashValue the hash mapping value

    function getTrustAnchorHashMappingValue(address _trustAnchorAddress, string memory _hashMappingName) public view returns (bool doesExist, bytes32 hashValue) {
        bytes32 hashMappingKeccak = keccak256(abi.encodePacked(_hashMappingName));

        // gets the hash mapping
        hashMapping storage existingHashMapping = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_hashMapping[hashMappingKeccak];

        // checks whether this particular hash mapping already exists for this Trust Anchor.
        if (existingHashMapping.doesExist == true) {
            //hash mapping data exists, and the hash value
            return (true, existingHashMapping.hashValue);
        } else {
            //hash mapping data does not exist
            return (false, 0);
        }
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @param _hashMappingKeccak The hash mapping keccak
    /// @dev Gets the hash mapping name for a specific hash mapping keccak for a Trust Anchor.
    /// @return hashMappingName hash mapping data exists, returns the hash mapping name
    function getTrustAnchorHashMappingNameByHashMappingKeccak(address _trustAnchorAddress, bytes32 _hashMappingKeccak) public view returns (string memory hashMappingName) {
        //returns the endpoint name
        return extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_hashMapping[_hashMappingKeccak].hashName;
    }

    // ** extraData numeric identifiers ** //

    /// @param _numericIdentifierName The name of the numeric identifier.
    /// @param _numericIdentifierValue The value for this numeric identifier, as a bytes32 (256 bits) format.
    /// @dev Checks whether a specific Trust Anchor has "unique" extraData associated to it with a specific numeric identifier name, updates if necessary, and returns the status.
    /// @notice Called by an already setup Trust Anchor.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: numeric identifier set for the first time
    ///    | 2: numeric identifier updated

    function setTrustAnchorNumericIdentifier(string memory _numericIdentifierName, uint256 _numericIdentifierValue) public returns (uint8 result) {
        bytes32 numericIdentifierKeccak = keccak256(abi.encodePacked(_numericIdentifierName));

        //@note: need to check Trust Anchor jurisdiction in Trust Anchor manager lookup
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {

            // get the numeric identifier if it already exists, otherwise create a new numeric identifier.
            numericIdentifier storage newNumericIdentifier = extraData_uniqueParameters[msg.sender].keccakHash_to_numericIdentifier[numericIdentifierKeccak];

            // set the parameters based on inputs.
            newNumericIdentifier.numericIdentifierName = _numericIdentifierName;
            newNumericIdentifier.numericIdentifierValue = _numericIdentifierValue;

            // checks whether this particular numeric identifier already exists for this Trust Anchor.
            if (newNumericIdentifier.doesExist == true) {
                // emit updated event
                emit EVT_setTrustAnchorNumericIdentifierUpdated(msg.sender, _numericIdentifierName, _numericIdentifierValue);

                //numeric identifier updated
                return 2;
            } else {
                // if numeric identifier doesn't already exist, set the parameters required for further lookups.
                newNumericIdentifier.doesExist = true;

                // sets the global "doesExist" for this Trust Anchor to true.. if it was already set, this doesn't cost
                // any extra gas at the end of the day because it's not changing state.
                extraData_uniqueParameters[msg.sender].doesExist = true;

                // pushes the new numericIdentifierKeccak to the numeric identifiers array.
                extraData_uniqueParameters[msg.sender].numericIdentifiersHashArray.push(numericIdentifierKeccak);

                // emit created event
                emit EVT_setTrustAnchorNumericIdentifierCreated(msg.sender, _numericIdentifierName, _numericIdentifierValue);

                //numeric identifier set for the first time
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @dev Gets the number of numeric identifiers associated to this Trust Anchor.
    /// @return result the number of numeric identifiers associated to this Trust Anchor.

    function getTrustAnchorNumberOfNumericIdentifiers(address _trustAnchorAddress) public view returns (uint256 result) {
        return extraData_uniqueParameters[_trustAnchorAddress].numericIdentifiersHashArray.length;
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _index The index within this Trust Anchor's numeric identifier array.
    /// @dev Gets the numeric identifier name for a specific index within the Trust Anchor's numeric identifier array.
    /// @notice Checks to make sure that the _index parameter is not out of bounds.
    /// @return doesExist whether numeric identifier data exists, ( false, "" ): numeric identifier data does not exist
    /// @return numericIdentifierName the numeric identifier name

    function getTrustAnchorNumericIdentifierNameByIndex(address _trustAnchorAddress, uint256 _index) public view returns (bool doesExist, string memory numericIdentifierName) {
        // checks whether this particular endpoint already exists for this Trust Anchor.
        if (extraData_uniqueParameters[_trustAnchorAddress].numericIdentifiersHashArray.length > _index) {
            bytes32 numericIdentifierKeccak = extraData_uniqueParameters[_trustAnchorAddress].numericIdentifiersHashArray[_index];

            numericIdentifier storage existingNumericIdentifier = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_numericIdentifier[numericIdentifierKeccak];

            //numeric identifier data exists, returns the numeric identifier name
            return (true, existingNumericIdentifier.numericIdentifierName);
        } else {
            //numeric identifier data does not exist
            return (false, "");
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _numericIdentifierName The name of the numeric identifier.
    /// @dev Gets the numeric identifier value parameters (whether it exists, the actual numeric identifier value) for this particular _numericIdentifierName.
    /// @return doesExist whether numeric identifier data exists, ( false, 0 ): numeric identifier data does not exist
    /// @return numericIdentifierValue the numeric identifier value

    function getTrustAnchorNumericIdentifierValue(address _trustAnchorAddress, string memory _numericIdentifierName) public view returns (bool doesExist, uint256 numericIdentifierValue) {
        bytes32 numericIdentifierKeccak = keccak256(abi.encodePacked(_numericIdentifierName));

        // gets the hash mapping
        numericIdentifier storage existingNumericIdentifier = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_numericIdentifier[numericIdentifierKeccak];

        // checks whether this particular hash mapping already exists for this Trust Anchor.
        if (existingNumericIdentifier.doesExist == true) {
            //numeric identifier data exists, and the hash value
            return (true, existingNumericIdentifier.numericIdentifierValue);
        } else {
            //numeric identifier data does not exist
            return (false, 0);
        }
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @param _numericIdentifierKeccak The numeric identifier keccak
    /// @dev Gets the numeric identifier name for a specific numeric identifier keccak for a Trust Anchor.
    /// @return numericIdentifierName numeric identifier data exists, returns the numeric identifier name
    function getTrustAnchorNumericIdentifierNameByNumericIdentifierKeccak(address _trustAnchorAddress, bytes32 _numericIdentifierKeccak) public view returns (string memory numericIdentifierName) {
        //returns the numeric identifier name
        return extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_numericIdentifier[_numericIdentifierKeccak].numericIdentifierName;
    }

    // ** extraData key value pairs ** //

    /// @param _keyValuePairName The name of the key-value pair.
    /// @param _keyValuePairValue The value for this key-value pair, as a String format.
    /// @dev Checks whether a specific Trust Anchor has "unique" extraData associated to it with a specific key-value pair name, updates if necessary, and returns the status.
    /// @notice Called by an already setup Trust Anchor.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: key-value pair set for the first time
    ///    | 2: key-value pair updated

    function setTrustAnchorKeyValuePair(string memory _keyValuePairName, string memory _keyValuePairValue) public returns (uint8 result) {
        bytes32 keyValuePairKeccak = keccak256(abi.encodePacked(_keyValuePairName));

        //@note: need to check Trust Anchor jurisdiction in Trust Anchor manager lookup
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {

            // get the key-value pair if it already exists, otherwise create a new key-value pair.
            keyValuePair storage newKeyValuePair = extraData_uniqueParameters[msg.sender].keccakHash_to_keyValuePair[keyValuePairKeccak];

            // set the parameters based on inputs.
            newKeyValuePair.keyValuePairName = _keyValuePairName;
            newKeyValuePair.keyValuePairValue = _keyValuePairValue;

            // checks whether this particular key-value pair already exists for this Trust Anchor.
            if (newKeyValuePair.doesExist == true) {
                // emit updated event
                emit EVT_setTrustAnchorKeyValuePairUpdated(msg.sender, _keyValuePairName, _keyValuePairValue);

                //key-value pair updated
                return 2;
            } else {
                // if key-value pair doesn't already exist, set the parameters required for further lookups.
                newKeyValuePair.doesExist = true;

                // sets the global "doesExist" for this Trust Anchor to true.. if it was already set, this doesn't cost
                // any extra gas at the end of the day because it's not changing state.
                extraData_uniqueParameters[msg.sender].doesExist = true;

                // pushes the new keyValuePairKeccak to the key-value pairs array.
                extraData_uniqueParameters[msg.sender].keyValuePairsHashArray.push(keyValuePairKeccak);

                // emit created event
                emit EVT_setTrustAnchorKeyValuePairCreated(msg.sender, _keyValuePairName, _keyValuePairValue);

                //key-value pair set for the first time
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @dev Gets the number of key-value pairs associated to this Trust Anchor.
    /// @return result the number of key-value pairs associated to this Trust Anchor.

    function getTrustAnchorNumberOfKeyValuePairs(address _trustAnchorAddress) public view returns (uint256 result) {
        return extraData_uniqueParameters[_trustAnchorAddress].keyValuePairsHashArray.length;
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _index The index within this Trust Anchor's key-value pair array.
    /// @dev Gets the key-value pair name (key) for a specific index within the Trust Anchor's key-value pair array.
    /// @notice Checks to make sure that the _index parameter is not out of bounds.
    /// @return doesExist whether the key-value pair data exists, ( false, "" ): key-value pair data does not exist
    /// @return keyValuePairName the key-value pair name (key)

    function getTrustAnchorKeyValuePairNameByIndex(address _trustAnchorAddress, uint256 _index) public view returns (bool doesExist, string memory keyValuePairName) {
        // checks whether this particular endpoint already exists for this Trust Anchor.
        if (extraData_uniqueParameters[_trustAnchorAddress].keyValuePairsHashArray.length > _index) {
            bytes32 keyValuePairKeccak = extraData_uniqueParameters[_trustAnchorAddress].keyValuePairsHashArray[_index];

            keyValuePair storage existingKeyValuePair = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_keyValuePair[keyValuePairKeccak];

            //key-value pair data exists, returns the key-value pair name (key)
            return (true, existingKeyValuePair.keyValuePairName);
        } else {
            //key-value pair data does not exist
            return (false, "");
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @param _keyValuePairName The name of the key-value pair.
    /// @dev Gets the key-value pair value parameters (whether it exists, the actual key-value pair value) for this particular _keyValuePairName.
    /// @return doesExist whether the key-value pair data exists, ( false, "" ): key-value pair data does not exist
    /// @return keyValuePairValue the key-value pair value

    function getTrustAnchorKeyValuePairValue(address _trustAnchorAddress, string memory _keyValuePairName) public view returns (bool doesExist, string memory keyValuePairValue) {
        bytes32 keyValuePairKeccak = keccak256(abi.encodePacked(_keyValuePairName));

        // gets the hash mapping
        keyValuePair storage existingKeyValuePair = extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_keyValuePair[keyValuePairKeccak];

        // checks whether this particular hash mapping already exists for this Trust Anchor.
        if (existingKeyValuePair.doesExist == true) {
            //key-value pair data exists, and the hash value
            return (true, existingKeyValuePair.keyValuePairValue);
        } else {
            //key-value pair data does not exist
            return (false, "");
        }
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @param _keyValuePairKeccak The key-value pair keccak
    /// @dev Gets the key-value pair name for a specific key-value pair keccak for a Trust Anchor.
    /// @return keyValuePairName key-value pair data exists, returns the key-value pair name
    function getTrustAnchorKeyValuePairNameByKeyValuePairKeccak(address _trustAnchorAddress, bytes32 _keyValuePairKeccak) public view returns (string memory keyValuePairName) {
        //returns the key-value pair name
        return extraData_uniqueParameters[_trustAnchorAddress].keccakHash_to_keyValuePair[_keyValuePairKeccak].keyValuePairName;
    }

    // ** extraData public metadata ** //

    /// @param _publicMetaData The public metadata to set.
    /// @dev Sets public metadata for this trust anchor. This could relate to purpose/status/etc. Any further calls to this will overwrite existing public metadata that has previously been set.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: public metadata set

    function setTrustAnchorPublicMetaData(string memory _publicMetaData) public returns (uint8 result) {
        //@note: need to check Trust Anchor jurisdiction in Trust Anchor manager lookup
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {

            // set public metadata.
            extraData_uniqueParameters[msg.sender].publicMetaData = _publicMetaData;

            // emit set event
            emit EVT_setTrustAnchorPublicMetaData(msg.sender, _publicMetaData);

            //public metadata set
            return 1;
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _trustAnchorAddress The Trust Anchor address related to this unique extraData.
    /// @dev Gets the public metadata for this Trust Anchor.
    /// @return publicMetaData the public metadata for this trust anchor

    function getTrustAnchorPublicMetaData(address _trustAnchorAddress) public view returns (string memory publicMetaData) {
        // returns the public metadata
        return extraData_uniqueParameters[_trustAnchorAddress].publicMetaData;
    }
}

